import React, {Component} from 'react';
import '././css/App.css';
import Header from './Header';
import Footer from './Footer';

class App extends Component {
  render(){
    return (
      <div >
        <Header />
        <Footer style ={{position: 'absolute', bottom: '0', width: '100%'}}/>
      </div>
    );
  }

}

export default App;
